--
-- Name: initialize_virtual_money(); Type: FUNCTION; Schema: public; Owner: trading_user
--

CREATE FUNCTION public.initialize_virtual_money() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Create virtual money config for new user
    VALUES (NEW.id, 100000.00);

    -- Create paper trading stats record
    VALUES (NEW.id);

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.initialize_virtual_money() OWNER TO trading_user;

--
-- Name: update_last_activity(); Type: FUNCTION; Schema: public; Owner: trading_user
--

CREATE FUNCTION public.update_last_activity() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    NEW.last_activity = CURRENT_TIMESTAMP;
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.update_last_activity() OWNER TO trading_user;

--
-- Name: update_paper_trading_stats(); Type: FUNCTION; Schema: public; Owner: trading_user
--

CREATE FUNCTION public.update_paper_trading_stats() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Update stats when a paper order is filled
    IF NEW.status = 'filled' AND OLD.status != 'filled' THEN
        VALUES (NEW.user_id, 1)
        ON CONFLICT (user_id) DO UPDATE
        SET total_trades = paper_trading_stats.total_trades + 1,
            updated_at = NOW();
    END IF;
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.update_paper_trading_stats() OWNER TO trading_user;

--
-- Name: update_updated_at_column(); Type: FUNCTION; Schema: public; Owner: trading_user
--

CREATE FUNCTION public.update_updated_at_column() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    NEW.updated_at = NOW();
    RETURN NEW;
END;
$$;


