CREATE TABLE public.gtt_orders (
    id uuid DEFAULT gen_random_uuid() NOT NULL,
    broker_connection_id uuid NOT NULL,
    trigger_id character varying(100) NOT NULL,
    symbol character varying(20) NOT NULL,
