--
-- Name: active_gtt_orders; Type: VIEW; Schema: public; Owner: trading_user
--

CREATE VIEW public.active_gtt_orders AS
 SELECT g.id,
    g.broker_connection_id,
    g.trigger_id,
    g.symbol,
    g.exchange,
    g.side,
    g.quantity,
    g.trigger_price,
    g.limit_price,
    g.trigger_type,
    g.product,
    g.status,
    g.created_at,
    g.triggered_at,
    g.expires_at,
    g.order_id,
    g.execution_details,
    g.is_active,
    g.updated_at,
    bc.user_id,
    bc.broker_type,
    u.username,
    u.email
   FROM ((public.gtt_orders g
     JOIN public.user_broker_connections bc ON ((g.broker_connection_id = bc.id)))
     JOIN public.users u ON ((bc.user_id = u.id)))
  WHERE ((g.is_active = true) AND ((g.status)::text = 'active'::text));


