--
-- Name: gtt_order_summary; Type: VIEW; Schema: public; Owner: trading_user
--

CREATE VIEW public.gtt_order_summary AS
 SELECT bc.user_id,
    bc.broker_type,
    count(*) AS total_gtt_orders,
    count(*) FILTER (WHERE ((g.status)::text = 'active'::text)) AS active_orders,
    count(*) FILTER (WHERE ((g.status)::text = 'triggered'::text)) AS triggered_orders,
    count(*) FILTER (WHERE ((g.status)::text = 'cancelled'::text)) AS cancelled_orders,
    count(*) FILTER (WHERE ((g.status)::text = 'expired'::text)) AS expired_orders,
    avg(g.trigger_price) AS avg_trigger_price,
    sum((g.quantity * g.trigger_price)) AS total_trigger_value
   FROM (public.gtt_orders g
     JOIN public.user_broker_connections bc ON ((g.broker_connection_id = bc.id)))
  WHERE (g.is_active = true)
  GROUP BY bc.user_id, bc.broker_type;


