--
-- Name: regional_assets; Type: VIEW; Schema: public; Owner: trading_user
--

CREATE VIEW public.regional_assets AS
 SELECT a.id,
    a.symbol,
    a.name,
    a.asset_type,
    a.exchange,
    a.currency,
    a.current_price,
    a.price_updated_at,
    a.is_active,
    a.metadata,
    a.created_at,
    a.updated_at,
    a.pb_ratio,
    a.dividend_yield,
    a.beta,
    a.industry,
    a.region,
    a.market_cap,
    a.sector,
        CASE
            WHEN ((a.region)::text = 'US'::text) THEN 'NASDAQ/NYSE'::character varying
            WHEN ((a.region)::text = 'IN'::text) THEN 'NSE/BSE'::character varying
            ELSE a.exchange
        END AS display_exchange,
        CASE
            WHEN ((a.region)::text = 'US'::text) THEN ARRAY['alpaca'::text]
            WHEN ((a.region)::text = 'IN'::text) THEN ARRAY['zerodha'::text]
            ELSE ARRAY[]::text[]
        END AS compatible_brokers
   FROM public.assets a
  WHERE (a.is_active = true);


