--
-- Name: regional_smallcases; Type: VIEW; Schema: public; Owner: trading_user
--

CREATE VIEW public.regional_smallcases AS
 SELECT s.id,
    s.name,
    s.description,
    s.category,
    s.theme,
    s.risk_level,
    s.expected_return_min,
    s.expected_return_max,
    s.minimum_investment,
    s.is_active,
    s.created_by,
    s.created_at,
    s.updated_at,
    s.strategy_type,
    s.expected_return_1y,
    s.expected_return_3y,
    s.expected_return_5y,
    s.volatility,
    s.sharpe_ratio,
    s.max_drawdown,
    s.expense_ratio,
    s.region,
    s.supported_brokers,
    s.currency,
    count(sc.id) AS constituent_count,
    sum(sc.weight_percentage) AS total_weight,
        CASE
            WHEN ((s.region)::text = 'US'::text) THEN 'United States'::character varying
            WHEN ((s.region)::text = 'IN'::text) THEN 'India'::character varying
            ELSE s.region
        END AS region_name
   FROM (public.smallcases s
     LEFT JOIN public.smallcase_constituents sc ON (((s.id = sc.smallcase_id) AND (sc.is_active = true))))
  WHERE (s.is_active = true)
  GROUP BY s.id, s.name, s.description, s.category, s.theme, s.risk_level, s.expected_return_min, s.expected_return_max, s.minimum_investment, s.is_active, s.created_by, s.created_at, s.updated_at, s.strategy_type, s.expected_return_1y, s.expected_return_3y, s.expected_return_5y, s.volatility, s.sharpe_ratio, s.max_drawdown, s.expense_ratio, s.region, s.supported_brokers, s.currency;


ALTER TABLE public.regional_smallcases OWNER TO trading_user;

--
-- Name: VIEW regional_smallcases; Type: COMMENT; Schema: public; Owner: trading_user
--

COMMENT ON VIEW public.regional_smallcases IS 'View of smallcases with regional filtering and constituent statistics';


